    /*Proporciona acceso directo a cualquier ejemplo almacenado*/
    public string[] GetLevel(int num, string rank)
    {
        if (num == 1)
        {
            if (rank.Equals("C")) { return level1_rankC; }
            else if (rank.Equals("B")) { return level1_rankB; }
            else if (rank.Equals("A")) { return level1_rankA; }
            else if (rank.Equals("A+")) { return level1_rankAplus; }
            else if (rank.Equals("S")) { return level1_rankS; }
            else if (rank.Equals("S+")) { return level1_rankSplus; }
            else
            {
                Debug.LogError("Fail in EjemplosString > GetLevel > Wrong rank parameter");
                return null;
            }
        }
        else if (num == 2)
        {
            if (rank.Equals("C")) { return level2_rankC; }
            else if (rank.Equals("B")) { return level2_rankB; }
            else if (rank.Equals("A")) { return level2_rankA; }
            else if (rank.Equals("A+")) { return level2_rankAplus; }
            else if (rank.Equals("S")) { return level2_rankS; }
            else if (rank.Equals("S+")) { return level2_rankSplus; }
            else
            {
                Debug.LogError("Fail in EjemplosString > GetLevel > Wrong rank parameter");
                return null;
            }
        }
        else if (num == 3)
        {
            if (rank.Equals("C")) { return level3_rankC; }
            else if (rank.Equals("B")) { return level3_rankB; }
            else if (rank.Equals("A")) { return level3_rankA; }
            else if (rank.Equals("A+")) { return level3_rankAplus; }
            else if (rank.Equals("S")) { return level3_rankS; }
            else if (rank.Equals("S+")) { return level3_rankSplus; }
            else
            {
                Debug.LogError("Fail in EjemplosString > GetLevel > Wrong rank parameter");
                return null;
            }
        }
        else
        {
            Debug.LogError("Fail in EjemplosString > GetLevel > Wrong num parameter");
            return null;
        }
    }
